import React from 'react';
import { Link } from 'react-router-dom'
import './navbar.css';

const Navbar = () => {
    return ( 
        <div>
            <nav>
                <h3>Customer Relationship Management</h3>
                <Link 
                    className = 'link float-right'
                    to='/'>Dashboard &nbsp;&nbsp;
                    </Link>

            </nav>
        </div>
    );
}

export default Navbar;
